import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>

    </div>
  );
}

function SideBar(){
  return(
    <div class="sidenav">
      <a href="#header">Autistic</a>
      <a href="#section1">About</a>
      <a href="#section2">Application</a>
      <a href="#contact">Contact</a>
    </div>
  );
}


export default App;
